},{"cell_type":"code","execution_count":21,"id":"61de1338","metadata":{"execution":{"iopub.execute_input":"2025-06-04T14:29:08.63435Z","iopub.status.busy":"2025-06-04T14:29:08.632723Z","iopub.status.idle":"2025-06-04T14:29:08.674399Z","shell.execute_reply":"2025-06-04T14:29:08.672484Z"},"papermill":{"duration":0.056999,"end_time":"2025-06-04T14:29:08.676643","exception":false,"start_time":"2025-06-04T14:29:08.619644","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Log-transformed Z-score: 2.22 \n"]},{"name":"stdout","output_type":"stream","text":["Parametric one-sided p-value: 0.01318 \n"]}],"source":["log_data <- time_to_current_rank %>%\n","  filter(PerformanceTierFactor == your_tier) %>%\n","  mutate(\n","    delay_days = as.numeric(time_to_current_tier),\n","    log_delay = log1p(delay_days)  # log1p handles 0 safely\n","  )\n","my_log_delay <- log_data %>%\n","  filter(UserId == 650) %>%\n","  pull(log_delay)\n","log_mean <- mean(log_data$log_delay, na.rm = TRUE)\n","log_sd   <- sd(log_data$log_delay, na.rm = TRUE)\n","\n","z_score <- (my_log_delay - log_mean) / log_sd\n","p_value <- pnorm(z_score, lower.tail = FALSE)  # one-sided upper tail\n","\n","cat(\"Log-transformed Z-score:\", round(z_score, 2), \"\\n\")\n","cat(\"Parametric one-sided p-value:\", signif(p_value, 4), \"\\n\")\n"]},{"cell_type":"markdown","id":"3fba4749","metadata":{"papermill":{"duration":0.011343,"end_time":"2025-06-04T14:29:08.69945","exception":false,"start_time":"2025-06-04T14:29:08.688107","status":"completed"},"tags":[]},"source":["## How much does it take to reach a rank within every category?\n","\n","There are four categories in Kaggle - Competitions, Datasets, Code, Discussion. The previous cells shows the stats for the highest of these four, for each user. In the plots below, we delve into every single cateogy"]},{"cell_type":"code","execution_count":22,"id":"a71b0e60","metadata":{"execution":{"iopub.execute_input":"2025-06-04T14:29: